// components/Home.js
import React from "react";
import pets from "../pets.png";
import "../App.css";
const Home = () => {
  return (
    <div className="home">
      <h1>Welcome to our Pet Store!</h1>
      <div className="content">
        <img className="img" src={pets} alt="Pet Store" />
      </div>
    </div>
  );
};

export default Home;
